import React from "react";
import "./News.css";
import image1 from "../User-images/laptop29.webp";
function News() {
  return (
    <div>
      <h1
        style={{
          textAlign: "center",
          fontFamily: "sans-serif",
          fontSize: "50px",
          marginTop: "25px",
        }}
      >
        <b>News</b>
      </h1>
      <h5 style={{ textAlign: "center" }}>
        Get the latest technology news and in-depth analysis from the expert
        analysts at Lappora.
      </h5>
      <hr style={{ marginLeft: "5%", marginRight: "5%" }} />
      <br />
      <div className="image-container">
        <div className="news-image">
          <img src={image1} alt="News image" />
        </div>
        <div>
          <h3>it is the hedding of the news</h3>
        </div>
      </div>
    </div>
  );
}

export default News;
